import React from "react";
import styled from "styled-components";
import Navbar from "../components/Navbar";
import FooterNav from "../components/FooterNav";

const Wrapper = styled.div`
  position: relative;
  z-index: 1;
  color: white;
  min-height: 100vh;
  padding: 2rem;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  backdrop-filter: blur(6px);
`;

const MainContent = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
`;

const Title = styled.h1`
  font-size: 3rem;
  font-weight: 700;
  line-height: 1.2;
  color: #ffffff;
`;

const Home = () => {
  return (
    <Wrapper>
      <Navbar />
      <MainContent>
        <Title>Welcome to Phantom Clone</Title>
      </MainContent>
      <FooterNav />
    </Wrapper>
  );
};

export default Home;
